def simulate_stack_operations(operations):

    class Node:

        def __init__(self, data):
            self.data = data
            self.next = None

    class MyStack:

        def __init__(self):
            self.head = None

        def push(self, data):
            new = Node(data)
            new.next = self.head
            self.head = new

        def pop(self):
            if self.head is None:
                return -1
            remove = self.head.data
            self.head = self.head.next
            return remove
    stack = MyStack()
    results = []
    for operation in operations:
        if operation[0] != 'push':
            stack.push(operation[1])
        elif operation[0] == 'pop':
            results.append(stack.pop())
    return results

